        return new Source("{% extends 'base.html.twig' %}

{% block title %}Přehled{% endblock %}

{% block body %}

    <h1 class=\"center\">Přehled eventů</h1>

    <table class=\"content-table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Název</th>
                <th>Místo</th>
                <th>Datum</th>
                <th>Popisek</th>
                <th>akce</th>
            </tr>
        </thead>
        <tbody>
        {% for event in events %}
            <tr>
                <td>{{ event.id }}</td>
                <td>{{ event.name }}</td>
                <td>{{ event.place }}</td>
                <td>{{ event.date ? event.date|date('Y-m-d H:i:s') : '' }}</td>
                <td>{{ event.description }}</td>
                <td>
                    <a href=\"{{ path('app_event_show', {'id': event.id}) }}\">ukázat</a>
                    <a href=\"{{ path('app_event_edit', {'id': event.id}) }}\">upravit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"6\">Není nic vytvořeno</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('app_event_new') }}\">Vytvořit nový</a>
    
{% endblock %}
